import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({

    container: {
        backgroundColor: '#f0f0f7',
        flex: 1,
    },

    teacherList: {
        marginTop: -40,
    },

    searchForm: {
        marginBottom: 8,
    },

    label: {
        color: '#c4c2ff',
        fontFamily: 'Poppins_400Regular',
    },

    inputGroup: {
        flexDirection: 'row',
        justifyContent: 'space-between',
    },

    inputBlock: {
        width: '48%'
    },

    input: {
        height: 54,
        backgroundColor: '#FFF',
        borderRadius: 8,
        justifyContent: 'center',
        padding: 16,
        marginTop: 4,
        marginBottom: 16,
    }, 

    submitButton: {
        backgroundColor: '#04d361',
        flex: 1,
        height: 56,
        borderRadius: 8,
        justifyContent: 'center',
        alignItems: 'center',
        marginRight: 8, 
    },

    submitButtonText: {

    }
});

export default styles;
